function refill(sourceForm,frm){for(var i=0;i<sourceForm.elements.length;i++)
{if(sourceForm.elements[i].name.indexOf("selected")>-1){if(sourceForm.elements[i].value=="on"){tempDiv=getElemByName(frm,sourceForm.elements[i].name);for(j=0;j<tempDiv.length;j++){if(tempDiv[j]!=null){tempDiv[j].checked=sourceForm.elements[i].checked;}}}else{var tempDiv=getElemByValue(frm,sourceForm.elements[i].value);if(tempDiv==null){alert(sourceForm.elements[i].name+" is null in export 2");}else{tempDiv.checked=sourceForm.elements[i].checked;}}}}}
function checkEmptySelection(sourceForm){var empty=true;for(var i=0;i<sourceForm.elements.length;i++){if(sourceForm.elements[i].name.indexOf("selected")>-1){if(sourceForm.elements[i].checked){empty=false;break;}}}
return empty;}
function popUpNoSelectionError(arg){if(arg=='EXPORT'){alert(messages.JS_OUTPUT_CITATION_ERROR_EXPORT());}else if(arg=='PRINT'){alert(messages.JS_OUTPUT_CITATION_ERROR_PRINT());}else if(arg=='EMAIL'){alert(messages.JS_OUTPUT_CITATION_ERROR_EMAIL());}}
function email(){var frm=document.EmailForm;for(j=0;j<frm.elements.length;j++){if(frm.elements[j].name=="view"){contentType=frm.elements[j].selectedIndex;if(frm.elements[j].options[frm.elements[j].selectedIndex].value=="SpecifyFields"){if(!checkEmptySelection(frm)){reFillSelectedFields(frm);frm.submit();}
else{popUpNoSelectionError("EMAIL");return false;}}}}}
function swapSection(idA,idB){var divA=document.getElementById(idA);var divB=document.getElementById(idB);if(!divA.style.display||divA.style.display=="block"){divA.style.display="none";divB.style.display="block";}else{divA.style.display="block";divB.style.display="none";}}
function verifyBodyLength(form){if(form["emailBody"].value.length>=2000){if(!confirm(messages.JS_OUTPUT_EMAIL_BODY_ERROR())){return false;}}
return true;}
